ption";s:2198:"Because I‚Äôm all about that barnwood look- aka free materials üòâ. This reclaimed fencing has come in so handy this summer. I‚Äôve used it in our backyard for the outdoor shower, chicken garden fence, as window trim, and to build a window box. I think the basement feature walls will probably be the only interior application, but it sure has been useful!

A lot of folks ask me how I find free or discounted finds and it‚Äôs really just investing the time in locating it on a local site and then being willing to do a lot of moving yourself. My favorite sites are: Craigslist, Next Door, Offer Up, and Facebook Marketplace. I also just go to the local Habitat Restore when I‚Äôm looking for specific things or have an idea in mind but am looking for specifics in how i can bring it to life.

The real work is in moving things yourself once you find a deal. How do you get it home? We renovated #BonnietheSilverStreak with a Mini Cooper and now we have a Prius that feels like a trailer bed because it‚Äôs like double the size, haha!  I know how to move tables and 8‚Äô lumber in a sedan just because I‚Äôve had to learn how to do it. (Always take tools to a sale to disassemble!) Sometimes things are too big so I either ask the seller if they would deliver for $20 or I use either Fluid or Turo to rent a truck or van for moving a large item, which typically costs about $40 for 2 hours of rental + a gas refill + I always do the premium $0 deductible insurance.

Why go through all this? I want to be able to live in a home I‚Äôve designed and that works best for us. Rosebud is basically just becoming more and more customized for us and doing the renovations in this way- with low cost sourcing and diy- makes it affordable for our budget. A bonus is that 90% of the time we‚Äôre saving lumber or a piece from the landfill!

